static const uint8_t JMBIB[] = {
    12,
    0x5A,0x64,0x02,0xF4,0xF5,0xFD,0x7F,0x00,0x55,0xBA,0x74,0x2A
};

// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMBIData(char *Buffer)
{
    memcpy(Buffer, &JMBIL0[1], JMBIL0[0] << 2);
    Buffer += (JMBIL0[0] << 2);

    memcpy(Buffer, &JMBIL1[1], JMBIL1[0] << 2);
    Buffer += (JMBIL1[0] << 2);

    memcpy(Buffer, &JMBIL2[1], JMBIL2[0] << 2);
    Buffer += (JMBIL2[0] << 2);

    memcpy(Buffer, &JMBIL3[1], JMBIL3[0] << 2);
    Buffer += (JMBIL3[0] << 2);

    memcpy(Buffer, &JMBIL4[1], JMBIL4[0] << 2);
    Buffer += (JMBIL4[0] << 2);

    memcpy(Buffer, &JMBIL5[1], JMBIL5[0] << 2);
    Buffer += (JMBIL5[0] << 2);

    memcpy(Buffer, &JMBIB[1], JMBIB[0]);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMBIName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMBIData(void)
{
    remove(JMBIName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMBIData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMBIName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMBIName)) return "";
    #endif

    if (!(han = fopen(JMBIName, "wb"))) return "";
    if (AutoClean) atexit(KillJMBIData);

    num = fwrite(&JMBIL0[1], 4, JMBIL0[0], han);
    if (num != JMBIL0[0]) {fclose(han); return "";}

    num = fwrite(&JMBIL1[1], 4, JMBIL1[0], han);
    if (num != JMBIL1[0]) {fclose(han); return "";}

    num = fwrite(&JMBIL2[1], 4, JMBIL2[0], han);
    if (num != JMBIL2[0]) {fclose(han); return "";}

    num = fwrite(&JMBIL3[1], 4, JMBIL3[0], han);
    if (num != JMBIL3[0]) {fclose(han); return "";}

    num = fwrite(&JMBIL4[1], 4, JMBIL4[0], han);
    if (num != JMBIL4[0]) {fclose(han); return "";}

    num = fwrite(&JMBIL5[1], 4, JMBIL5[0], han);
    if (num != JMBIL5[0]) {fclose(han); return "";}

    num = fwrite(&JMBIB[1], 1, JMBIB[0], han);
    if (num != JMBIB[0]) {fclose(han); return "";}

    fclose(han);
    return JMBIName;
}

